INSERT INTO specialization (id, name, name_eng, active, applying_knowledge_and_understanding_outcomes, applying_knowledge_and_understanding_outcomes_eng, program_head_info, program_head_info_eng, program_head_name, program_head_name_eng, knowledge_and_understanding_outcomes, knowledge_and_understanding_outcomes_eng, making_judgements_outcomes, making_judgements_outcomes_eng, payment_extramural, payment_fulltime, qualification, qualification_eng, degree_id, department_id, faculty_id, speciality_id) VALUES (9, 'Інформаційні управляючі системи та технології', 'Information Control Systems and Technology', true, 'здатність організовувати й проводити наукові дослідження, пов’язані з розробкою проектів і програм, що спрямовані на вирішення конкретних наукових задач у сфері комп’ютерних наук та інформаційних технологій і систем; володіння методами системного аналізу і здатність їх використовувати для дослідження об’єктів нової техніки, інформаційних, виробничих та економічних систем; здатність до моделювання і дослідження математичними методами та засобами процесів прийняття рішень і процесів управління; здатність до управління науковою та інноваційною діяльністю у галузі інформаційних технологій; здатність управляти науковими, науково-технічними і технологічними проектами, зокрема ІТ-проектами; здатність працювати із сучасними інформаційними системами управління, що застосовуються в економічній діяльності; здатність використовувати інноваційні педагогічні та інформаційно-комунікаційні технології навчання у освітньому процесі вищої школи', 'ability to organize and provide scientific research related to the development of projects and programs, which are directed to solving the concrete scientific problems in computer science and information technology and systems; good command of system analysis methods and ability to use them for researching the new technology objects, information, manufacturing, and economical systems; ability to model and research the management and decision making processes with mathematical methods and tools; ability to manage scientific and innovation projects in information technology; ability to manage the scientific and technology projects, specifically IT projects; ability to work with modern information systems used in economics; ability to use innovative pedagogical and information-communication technology at university teaching', 'кандидат технічних наук, доцент', 'Ph.D. in Engineering, Associate Professor', 'Саух Валерій Михайлович', 'Saukh Valerii Mykhailovych', 'концептуальних засад системного підходу до проектування інформаційних систем; інноваційних підходів до проектування інформаційних систем і технологій; принципів і методів стратегічного управління організаціями та процесами у сфері інформаційних технологій; методології  наукових  досліджень  та  методики  навчання  професійно  орієнтованих дисциплін', 'conceptual principles of system approach to information systems design; innovative approach to information systems and technology design; principles and methods of strategic management of organizations and processes in information technology; methodology of scientific research and methods of teaching the profession-oriented courses', 'визначення критеріїв та оцінювання рівня розвитку  комп’ютерних систем  та інформаційних технологій; обґрунтування  стратегічних  альтернатив  розвитку  комп’ютерних систем  та інформаційних технологій за визначеними критеріями; розроблення  критеріїв   та   оцінювання  ефективності   управлінських  рішень   у  сфері інформаційних технологій', 'determine criteria and assess information systems and information technology level; verify strategic alternatives of information systems and information technology development for stable criteria; make out criteria and assess the management decisions efficiency in information technology', NULL, NULL, 'Магістр комп''ютерних наук та інформаційних технологій. Аналітик комп’ютерних систем', 'Master of Computer Sciences and Information Technology. Analyst of Computer Systems', 3, 5, 1, 2);
INSERT INTO specialization (id, name, name_eng, active, applying_knowledge_and_understanding_outcomes, applying_knowledge_and_understanding_outcomes_eng, program_head_info, program_head_info_eng, program_head_name, program_head_name_eng, knowledge_and_understanding_outcomes, knowledge_and_understanding_outcomes_eng, making_judgements_outcomes, making_judgements_outcomes_eng, payment_extramural, payment_fulltime, qualification, qualification_eng, degree_id, department_id, faculty_id, speciality_id) VALUES (5, 'Інформаційні технології проектування', 'Engineering Information Technology', true, 'здатність компетентно вирішувати професійні завдання; здатність поєднувати систему знань та практичних навичок у фаховій діяльності у відповідності до сучасного стану розвитку інформаційних технологій; здатність проведення наукових досліджень у галузі проектування і створення інформаційних технологій; здатність організовувати освітній процес у вищому навчальному закладі з професійно-орієнтованих дисциплін з використанням сучасних інформаційних технологій', 'ability to competently solve professional tasks; ability to combine the system of knowledge and practical skills in the professional activity in accordance with the current state of development of information technologies; ability to carry out scientific research in the field of design and creation of information technologies; the ability to organize an educational process of professionally oriented disciplines using modern information technologies in a higher educational institution', 'доктор технічних наук, професор', 'Doctor of Technical Science, Professor', 'Златкін Артур Анатолійович', 'Zlatkin Arthur Anatolievych', 'володіння основними функціями безпосереднього і опосередкованого спілкування іноземною мовою в типових ситуаціях; розуміння впливу нових інформаційних технологій на освітній процес у вищій школі; знання вимог до системи управління охороною праці щодо підприємства (підрозділу) в галузі інформаційних технологій; знання методів і засобів проектування інтелектуальних інформаційних систем; знання теоретичних основ штучних нейронних мереж; знання сучасних методів проектування складних систем', 'skills of direct and indirect communication in a foreign language in typical situations; understanding of the impact of new information technologies on the educational process in higher education; knowledge of the requirements for the system of management of labor protection concerning the enterprise (unit) in the field of information technologies; knowledge of methods and means of designing intelligent information systems; knowledge of the theoretical foundations of artificial neural networks; knowledge of modern methods of designing complex systems', 'логічна аргументація; аналітичне мислення; алгоритмічне мислення; узагальнення і систематизація знань; здатність компетентно приймати рішення при вирішенні професійних завдань галузі інформаційних технологій проектування; володіння дослідницьким інструментарієм, необхідним для вдосконалення та перетворення об''єктів інформатизації та комп''ютеризації; здатність використовувати професійні знання й практичні навички для вирішення практичних завдань в галузі інформаційних технологій проектування', 'logical argument; analytical thinking; algorithmic thinking; generalization and systematization of knowledge; ability to make competent decisions in solving professional tasks of the field of information technology design; research skills necessary for the improvement and transformation of objects of informatization and computerization; the ability to use professional knowledge and practical skills to solve practical tasks in the field of information technology design', NULL, NULL, 'Магістр з комп''ютерних наук та інформаційних технологій; Аналітик комп''ютерних систем', 'Master of Computer Sciences and Information Technology; Analyst of Computer Systems', 3, 5, 1, 2);
INSERT INTO specialization (id, name, name_eng, active, applying_knowledge_and_understanding_outcomes, applying_knowledge_and_understanding_outcomes_eng, program_head_info, program_head_info_eng, program_head_name, program_head_name_eng, knowledge_and_understanding_outcomes, knowledge_and_understanding_outcomes_eng, making_judgements_outcomes, making_judgements_outcomes_eng, payment_extramural, payment_fulltime, qualification, qualification_eng, degree_id, department_id, faculty_id, speciality_id) VALUES (2, 'Інженерія програмного забезпечення', 'Software Engineering', true, 'здатність розробляти математичні моделі компонентів об’єктів проектування програмних проектів, виконувати їх верифікацію та атестацію; володіти науковими методами управління програмними проектами, знаходити оптимальні рішення в умовах автоматизованих методів формулювання гіпотез та їх перевірки', 'to have the ability to develop mathematical models of design components object for software projects, to perform their verification and certification; to know scientific methods of software project management, to find optimal solutions in terms of automated methods for formulating hypotheses and their testing', 'кандидат технічних наук, доцент', 'Candidate of Technical Sciences, Associate Professor', 'Воробкало Тетяна Василівна', 'Tetyana Vasylivna Vorobkalo', 'знання процесів планування, координації, кількісної оцінки, моніторингу, контролю та звітності в процесі наукової і практичної діяльності з розробки та супроводу програмних систем; розуміння базових уявлень про сучасні стандарти та процеси управління якістю програмного забезпечення', 'planning, coordination, quantitative assessment, monitoring, control and reporting skills in the process of research and practical activity for the development and support of software systems; abilities to understand the basic concepts of modern standards and processes of quality software management', 'використовувати професійно-профільовані знання й уміння в галузі теоретичного аналізу і використання інформаційних технологій; визначати ефективність програмних  проектів в умовах	 експериментального і теоретичного дослідження програмного забезпечення комп’ютерних систем', 'to use professionally profiled skills and abilities in the field of theoretical and practical analysis and usage of information technologies; to determine the effectiveness of software projects in the conditions of experimental', NULL, NULL, 'Магістр з інженерії програмного забезпечення', 'Master of Software Engineering', 3, 4, 1, 1);
INSERT INTO specialization (id, name, name_eng, active, applying_knowledge_and_understanding_outcomes, applying_knowledge_and_understanding_outcomes_eng, program_head_info, program_head_info_eng, program_head_name, program_head_name_eng, knowledge_and_understanding_outcomes, knowledge_and_understanding_outcomes_eng, making_judgements_outcomes, making_judgements_outcomes_eng, payment_extramural, payment_fulltime, qualification, qualification_eng, degree_id, department_id, faculty_id, speciality_id) VALUES (11, 'Спеціалізовані комп''ютерні системи', 'Specialized Computer Systems', true, 'Здатність досліджувати, проектувати і оптимально використовувати компоненти комп’ютерних систем, здійснювати наукову та інноваційну діяльність в галузі', 'Ability to explore, design and optimally use components of computer systems, to carry out scientific and innovative activities in the field', 'кандидат технічних наук, доцент', 'Ph.D. in Engineering, Associate Professor', 'Нечипоренко Ольга Володимирівна', 'Nechyporenko Olga', 'Знання методології наукових досліджень, принципів використання сучасних технологій розробки та оптимізації програмного і апаратного забезпечення при дослідженні і проектуванні спеціалізованих та вбудованих комп’ютерних систем', 'Knowledge of the methodology of scientific research, the principles of using modern technologies for the development and optimization of software and hardware in the study and design of specialized and embedded computer systems', 'Досягнення в галузі інформаційних технологій, комп’ютерні технології, системи і їх компоненти, способи і методи проектування, тестування, виробництва та експлуатації в умовах інформаційного суспільства', 'Achievements in the field of information technologies, computer technologies, systems and their components, methods and methods of designing, testing, production and operation in the conditions of the information society', NULL, NULL, 'Магістр комп’ютерної інженерії; розробник обчислювальних систем', 'Master of Computer Engineering; Developer of Computing Systems', 3, 1, 1, 3);
INSERT INTO specialization (id, name, name_eng, active, applying_knowledge_and_understanding_outcomes, applying_knowledge_and_understanding_outcomes_eng, program_head_info, program_head_info_eng, program_head_name, program_head_name_eng, knowledge_and_understanding_outcomes, knowledge_and_understanding_outcomes_eng, making_judgements_outcomes, making_judgements_outcomes_eng, payment_extramural, payment_fulltime, qualification, qualification_eng, degree_id, department_id, faculty_id, speciality_id) VALUES (14, 'Комп''ютерні системи та мережі', 'Computer Systems and Networks', true, 'представляти результати професійної діяльності та наукових досліджень з використанням сучасних інформаційно-комунікаційних технологій; планувати, проводити та обробляти результати наукових досліджень у комп’ютерних системах та мережах; виконувати моделювання елементів комп’ютерних систем і мереж, досліджувати створені моделі та оцінювати результати моделювання; розв’язувати складні та масштабні задачі з використанням комп’ютерних систем; вирішувати задачі створення, дослідження та налаштування систем кібербезпеки; застосовувати іноземну мову як засіб наукової та професійної комунікації', 'to present the results of professional activity and scientific researches using modern information and communication technologies; to plan, conduct and process the results of scientific research in computer systems and networks; to simulate the elements of computer systems and networks, to study the created models and to evaluate the results of simulation; to solve complex and large-scale tasks using computer systems; to solve problems of creation, research and adjustment of cybersecurity systems; to apply a foreign language as a means of scientific and professional communication', 'кандидат технічних наук, доцент', 'PhD, Associate Professor', 'Фауре Еміль Віталійович', 'Emil Faure', 'концептуальних засад розробки та дослідження комп’ютерних систем та мереж; інноваційних підходів до розв’язання складних задач і проблем у галузі комп’ютерної інженерії; методології наукових досліджень та методики викладання професійно орієнтованих дисциплін', 'conceptual foundations of computer systems and networks development and research; innovative approaches to solving complex problems and tasks in the field of computer engineering; methodology of scientific research and teaching methods for professionally oriented disciplines', 'формулювання вимог до організаційного, технічного та програмного забезпечення комп’ютерних систем і мереж; визначення та обґрунтування переліку критеріїв якості та ефективності апаратних і програмних виробів, збір та оброблення результатів експериментальних досліджень; оцінювання ступенів вразливостей і ризиків інформаційного захисту комп’ютерних систем і мереж', 'formulation of requirements for organizational support, hardware, and software of computer systems and networks; definition and substantiation of the list of quality and efficiency criteria for hardware and software products, collection and processing of experimental research results; assessment of vulnerabilities and risks of information protection of computer systems and networks', NULL, NULL, 'Магістр з комп''ютерної інженерії; Професіонал в галузі обчислювальних систем', 'Master of Computer Engineering;  Professional in Computer Systems', 3, 1, 1, 3);
INSERT INTO specialization (id, name, name_eng, active, applying_knowledge_and_understanding_outcomes, applying_knowledge_and_understanding_outcomes_eng, program_head_info, program_head_info_eng, program_head_name, program_head_name_eng, knowledge_and_understanding_outcomes, knowledge_and_understanding_outcomes_eng, making_judgements_outcomes, making_judgements_outcomes_eng, payment_extramural, payment_fulltime, qualification, qualification_eng, degree_id, department_id, faculty_id, speciality_id) VALUES (16, 'Системне програмування', 'System Programming', true, 'представляти результати професійної діяльності та наукових досліджень з використанням сучасних інформаційно-комунікаційних технологій; організовувати й проводити наукові дослідження, пов’язані з розробкою проектів і програм, що направлені на вирішення конкретних наукових задач в сфері комп’ютерних систем та компонентів; створення інноваційних програмних продуктів як форми керованого розвитку об’єкта в технічній сфері, заснованої на використанні наукових досліджень і розробок, провідного досвіду; вирішувати задачі створення, дослідження та налаштування систем кібербезпеки; застосовувати іноземну мову як засіб наукової та професійної комунікації', 'to present the results of professional activity and scientific researches using modern information and communication technologies; to organize and carry out scientific research related to the development of projects and programs aimed at solving specific scientific problems in the field of computer systems and components; creation of innovative software products as a form of the controlled development of the object in the technical field, based on the use of scientific research and development, leading experience; to solve problems of creation, research and adjustment of cybersecurity systems; apply a foreign language as a means of scientific and professional communication', 'кандидат технічних наук, доцент', 'PhD, Associate Professor', 'Федотова-Півень Ірина Миколаївна', 'Fedotova-Piven Iryna', 'концептуальних засад розробки та дослідження системного програмування комп’ютерних систем та компонентів; інноваційних підходів до розв’язання складних задач і проблем у галузі комп’ютерної інженерії; методології наукових досліджень та методики викладання професійно орієнтованих дисциплін', 'conceptual bases of development and research of the system programming of computer systems and components; innovative approaches to the solving of complex problems and problems in the field of the computer engineering; methodology of the scientific research and teaching methods for professionally oriented disciplines', 'про методи застосування 64 розрядних регістрів для розв’язання задач системного програмування; про забезпечення архітектурних та швидкісних вимог до роботи різних системних програм і утиліт; про технічні, організаційні та програмні засоби захисту системних програм від несанкціонованого втручання; про оцінювання ризиків вразливості системного програмного забезпечення', 'on the methods of using 64-bit registers for solving system programming tasks; to provide architectural and high-speed requirements for the work of various system software and utilities; technical, organizational and software means for protecting system programs from unauthorized interference; Risk Assessment of System Software Vulnerability', NULL, NULL, 'Магістр з комп''ютерної інженерії; Професіонал в галузі програмування, системний програміст', 'Master of Computer Engineering;  Professional іn Programming, System Programmer', 3, 1, 1, 3);
INSERT INTO specialization (id, name, name_eng, active, applying_knowledge_and_understanding_outcomes, applying_knowledge_and_understanding_outcomes_eng, program_head_info, program_head_info_eng, program_head_name, program_head_name_eng, knowledge_and_understanding_outcomes, knowledge_and_understanding_outcomes_eng, making_judgements_outcomes, making_judgements_outcomes_eng, payment_extramural, payment_fulltime, qualification, qualification_eng, degree_id, department_id, faculty_id, speciality_id) VALUES (18, 'Системи і методи прийняття рішень', 'Systems and Methods of Decision Making', true, 'здатність організовувати й проводити наукові дослідження, пов’язані з розробкою проектів і програм, що спрямовані на вирішення конкретних наукових задач у сфері системного аналізу та систем підтримки прийняття рішень; володіння методами системного аналізу і здатність їх використовувати для дослідження об’єктів нової техніки, інформаційних, виробничих та економічних систем; здатність до моделювання і дослідження математичними методами та засобами процесів прийняття рішень і процесів управління; здатність до управління науковою та інноваційною діяльністю у галузі інформаційних технологій та систем підтримки прийняття рішень; здатність застосовувати емпіричні, наукові та інноваційні методи і засоби інженерії програмного забезпечення для створення систем підтримки прийняття рішень; здатність працювати із системами підтримки прийняття рішень, що застосовуються в економічній діяльності; здатність використовувати інноваційні педагогічні та інформаційно-комунікаційні технології навчання у освітньому процесі вищої школи', 'ability to organize and provide scientific research related to the development of projects and programs, which are directed to solving the concrete scientific problems in system analysis and decision making support systems; good command of system analysis methods and ability to use them for researching the new technology objects, information, manufacturing, and economical systems; ability to model and research the management and decision making processes with mathematical methods and tools; ability to manage scientific and innovation projects in information technology and decision making support systems; ability to use empirical , scientific, and innovative methods and tools of software engineering for decision making support systems development; ability to work with decision making support systems used in economics; ability to use innovative pedagogical and information-communication technology at university teaching', 'кандидат фізико-математичних наук, доктор педагогічних наук', 'Professor, Candidate of Physical-Mathematical Science, Doctor of Pedagogical Science', 'Триус Юрій Васильович', 'Tryus Yurii Vasyliovych', 'концептуальних засад системного підходу до проектування інформаційних систем; інноваційних підходів до проектування систем підтримки прийняття рішень; принципів і методів стратегічного управління організаціями та процесами у сфері інформаційних технологій; методології  наукових  досліджень  та  методики  навчання  професійно  орієнтованих дисциплін', 'conceptual principles of system approach to information systems design; innovative approaches to decision making support systems design; principles and methods of organization and process strategic management  in information technology; methodology of scientific research and methods of teaching the profession-oriented courses', 'визначення критеріїв та оцінювання рівня розвитку систем підтримки прийняття рішень та інформаційних технологій; обґрунтування стратегічних альтернатив розвитку систем підтримки прийняття рішень та інформаційних технологій за визначеними критеріями; розроблення критеріїв та оцінювання ефективності управлінських рішень у сфері інформаційних технологій', 'determine criteria and assess decision making support systems and information technology level; verify strategic alternatives of decision making support systems and information technology development for stable criteria; make out criteria and assess the management decisions efficiency in information technology', NULL, NULL, 'Магістр системного аналізу; Аналітик комп''ютерних систем', 'Master of System Analysis. Computer Systems Analyst', 3, 5, 1, 4);
